package com.ly.provider.sys.entity;import java.io.Serializable;/** * Created by liyu2 on 2017/10/24. */public class UserRole implements Serializable {    private long urId;    private long userId;    private long role_id;    private int isenale;    private String addTime;    private String addUser ;    private String modTime;    private String modUser;    public long getUrId() {        return urId;    }    public void setUrId(long urId) {        this.urId = urId;    }    public long getUserId() {        return userId;    }    public void setUserId(long userId) {        this.userId = userId;    }    public long getRole_id() {        return role_id;    }    public void setRole_id(long role_id) {        this.role_id = role_id;    }    public int getIsenale() {        return isenale;    }    public void setIsenale(int isenale) {        this.isenale = isenale;    }    public String getAddTime() {        return addTime;    }    public void setAddTime(String addTime) {        this.addTime = addTime;    }    public String getAddUser() {        return addUser;    }    public void setAddUser(String addUser) {        this.addUser = addUser;    }    public String getModTime() {        return modTime;    }    public void setModTime(String modTime) {        this.modTime = modTime;    }    public String getModUser() {        return modUser;    }    public void setModUser(String modUser) {        this.modUser = modUser;    }}